(1061, '臺北市動物之家', '狗', '混種狗', '女', '中型', '黑色', '無', '是', '否', '動物之家', 'OPEN', '(所內絕育)大家好～我是嬌嬌!初次見面~下我的表現可能會有點害羞，不過其實我的個性很友善，摸摸我或跟我互動都可以唷^^雖然在動物之家中有很多很多的黑色米克斯狗狗，不過仍期待你們能夠發現屬於我獨特的美，可以給我一個完整的家！', '無', '2016-07-25', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/20074_105042403_1_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
