(1064, '臺北市動物之家', '狗', '混種狗', '男', '中型', '黃色', '無', '是', '否', '竹子湖路與中興路交叉口', 'OPEN', '(所內絕育)緊張，害羞，緊迫會攻擊。大家好，我是款款。我的個性害羞，剛來到籠舍時我都在角落不敢靠近，待了一年多，現在也已經進步嘍，會到門口、會聞聞你，但是你想摸我，我又退縮了，請不要強迫我，再給我時間與多些耐心，更給我一個真正的家，專屬的家人，相信我會進步更快！', '無', '2016-04-27', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/41a0fd1e-a99a-4397-a8a5-36445124506f_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
