(1658, '臺北市動物之家', '狗', '混種狗', '男', '中型', '黑色', '成年', '是', '否', '承德路二段', 'OPEN', '友善，可碰，乖，左前肢傷口，後肢骨折，心絲蟲您好，我是大東。就在前幾個週末，因為有人看我好像變瘦帶我檢查，結果發現我有心絲蟲。住了那麼久，中了大家可能不會想認養的病，我還有被治療的機會嗎？我想懷抱希望！因為我本來就是樂觀的狗狗。大東精神活潑，不像年紀很大的狗狗，帥、好奇心重、勇敢，他是工作人員帶出來，第一個自己跑到兩層推車上，還可以推著玩的狗狗，在籠子裡有時會自己推著碗玩滑壘，非常有趣^^會坐下、握手。你願意和他一起走很久很久嗎 <3(所內絕育)', '無', '2015-12-20', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/eee1e0bb-2c6f-47a2-8089-c5a8e231dcad_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
(1659, '臺北市動物之家', '狗', '混種狗', '女', '中型', '黑色', '無', '否', '否', '敦化北路', 'OPEN', '右剪耳，友善，非常好動，可碰，不親狗大家好~ 我是MaLuco，活潑快樂的我要的是一個陪我一輩子，不論我變老變呆，不離不棄的家，我對每個人都很友善，期待會遇見那個人，合拍的感應，快快出現吧^^', '無', '2017-05-10', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/c707299b-dc72-4c0f-822f-c7f62357c0b0_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
(1660, '臺北市動物之家', '狗', '混種狗', '女', '中型', '黑白色', '無', '是', '否', '新光路2段', 'OPEN', '我是小菲，我很內向，比較容易緊張，會跟你保持距離，但不會攻擊，慢慢來我們可以一起散步。花些時間多幾次跟我互動、講講話、摸摸我，讓我知道你對我好，我會是很乖的隻陪伴犬唷，相信將來我也可以開心的搖尾巴。(所內絕育)', '無', '2017-05-21', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/46f635eb-7a38-478a-99b7-ddef0df11822_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
