(1664, '臺北市動物之家', '狗', '混種狗', '女', '中型', '黃色', '無', '是', '否', '老泉街26巷', 'OPEN', '左前趾間腫，105.10.24絕育 106.7.12 左前趾間腫 大家好，我是波妞。我比較害羞怕生，要先讓我熟悉你，再輕輕溫柔的靠近，還是可以帶我出來走走。但要我像親人的狗狗一樣塞乃，可能還需要一段時間與互動唷。就是喜歡這種慢慢來的步伐的話，歡迎你來認識我，更希望你帶我回家唷。(所內絕育)', '無', '2017-08-02', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/d77fc728-bbfb-45c7-8a05-229fabca4c1b_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
