(1666, '臺北市動物之家', '狗', '混種狗', '女', '中型', '黑色', '無', '是', '否', '長沙街2段', 'OPEN', '友善，非常好動，可碰，愛撒嬌，不親狗，很會鑽(開門注意)-----------------我是艾沙個性大方活潑我喜歡跟大家互動是個很親人的女生但我吃飯的時候不喜歡別人打擾哦趕快來動物之家找我吧！(所內絕育)', '無', '2016-05-12', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/d7c332b1-fc2c-4610-89a1-09e42667be0a_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
