(1734, '臺北市動物之家', '狗', '混種狗', '男', '中型', '虎斑色', '無', '是', '否', '文昌路', 'OPEN', '友善，可碰，緊張，乖你好~ 我是有著美麗膚色的琥珀。等呀等~ 我的個性比較獨立，不會跟每個人都親近，但不代表我不喜歡跟你親近，我只是正等著一個契合的人。希望在時間培養下，我也有一個有點黏又不會太黏的好夥伴，相伴一生。喜歡虎斑狗狗的朋友，請給我一個機會唷！(所內絕育)', '無', '2021-04-10', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/3f136140-fa83-4eb6-8533-8eac4f6c406b_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
