(1925, '臺北市動物之家', '狗', '混種狗', '女', '中型', '黑色', '無', '是', '否', '瑞光路', 'OPEN', '你打算找一隻一起運動的狗狗嗎，鬼鬼會很適合你的需求，她活動量大，需要到大空間大場地動動，喜歡跑跳、探索、力氣衝勁大！年輕狗狗需要消耗精力，身心才會健康。她的個性熱情活潑。鬼鬼親狗，看到狗就想趕快去認識，快跟她玩。鬼鬼親近人，你離開她會癡癡望著門口，等待你從那裡進來。玩完了，她可以在你旁邊休息，但你一有動靜，她馬上也動。會注意你的舉動，也會注意周遭的動靜。這麼貼心、年輕、活動力量十足的鬼鬼，是你想要的嗎？？他正在動物之家等著你來認識！(所內絕育)', '無', '2021-04-10', '2999-12-31', '臺北市動物之家', 'https://asms.coa.gov.tw/amlapp/upload/pic/25743_106081205_2_org.jpg', '臺北市內湖區潭美街852號', '02-87913254', 2),
